import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ViewAirplanes.css';

export default function ViewAirplanes() {
  const [planes, setPlanes] = useState([]);
  const [loading, setLoading] = useState(false);

  const fetchPlanes = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/airplanes');
      setPlanes(res.data);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchPlanes();
  }, []);

  return (
    <div className="view-container">
      <h2>View Airplanes</h2>
      <button className="refresh-btn" onClick={fetchPlanes} disabled={loading}>
        {loading ? 'Loading…' : 'Refresh'}
      </button>

      <table className="data-table">
        <thead>
          <tr>
            <th>Airline ID</th>
            <th>Tail #</th>
            <th># Seats</th>
            <th>Speed</th>
            <th>Location ID</th>
            <th>Type</th>
            <th>Maintenanced</th>
            <th>Model</th>
            <th>NEO?</th>
          </tr>
        </thead>
        <tbody>
          {planes.map((p, i) => (
            <tr key={`${p.airlineID}-${p.tail_num}-${i}`}>
              <td>{p.airlineID}</td>
              <td>{p.tail_num}</td>
              <td>{p.seat_capacity}</td>
              <td>{p.speed}</td>
              <td>{p.locationID || '—'}</td>
              <td>{p.plane_type || '—'}</td>
              <td>{p.maintenanced == null ? '—' : p.maintenanced.toString().toUpperCase()}</td>
              <td>{p.model || '—'}</td>
              <td>{p.neo == null ? '—' : p.neo.toString().toUpperCase()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
